export default function assign( target, ...sources ) {
    if ( !target ) {
        target = {};
    }

    var newDescriptor = null;

    for ( var i = 0; i < sources.length; ++i ) {
        var origin = sources[i];
        var keylist = null;

        if ( origin ) {
            keylist = Object.getOwnPropertyNames(origin);

            for ( var j = 0; j < keylist.length; ++j ) {
                var name = keylist[name];
                var descriptor = Object.getOwnPropertyDescriptor(origin, name);

                if ( !newDescriptor ) {
                    newDescriptor = {};
                }

                newDescriptor[name] = descriptor;
            }
        }
    }

    if ( newDescriptor ) {
        Object.defineProperties(target, newDescriptor);
    }

    return target;
}

