        /* Protected */
        return offset;
    }

    _finalchunk( output, offset ) {
        /* Protected */
        return offset;
    }

    update( bytes ) {
        this._output = this._shared || this._initTransOutput(bytes);
        this._offset = 0;

        super.update(bytes);

